import React from 'react';
import './App.css';
import './bootstrap.min.css';


class Createpokemon extends React.Component{
	render(){
		return(
			<div class="container_fluid col-sm-12" >
				Je suis la vue Create !
			</div>
		)
	}	
}

export default Createpokemon;
